@RosiesHelper @Go4gold100 @MeanderingPaul @Nick_Nomi @kjlherbalife @Tanners1983 @FarrellySharon @BorisJohnson Of course I understand. My contention is that leaving the EU isn't going to help because:
1) there will be fewer jobs
2) there'll be no meaningful reduction in immigration - Leave leaders have even said this! - it's almost like they were trying to 'fool' people eh!

@RosiesHelper @Go4gold100 @MeanderingPaul @Nick_Nomi @kjlherbalife @Tanners1983 @FarrellySharon @BorisJohnson Not listening to what? You're suggesting that people on Min wage or unemployed will not be affected by Brexit - ie recession!
I'm suggesting that's nonsense and that they -will- be affected. The people at the bottom are ALWAYS affected!
Someone's certainly not listening!

@RosiesHelper @Go4gold100 @MeanderingPaul @Nick_Nomi @kjlherbalife @Tanners1983 @FarrellySharon @BorisJohnson No sure what you'rw missing here? People have openly admitted being fooled by the Leave campaign. How is that hard to understand?
Not everyone, but 'some' people. It would be amazing if that were not true.

Are you honestly saying you believe no one was fooled?

@RosiesHelper @Go4gold100 @MeanderingPaul @Nick_Nomi @kjlherbalife @Tanners1983 @FarrellySharon @BorisJohnson Working class? Brexit most certainly -isn't- a class divide!
But even so, I never said that, and being 'ignorant' isn't the point when the #DishonestByDesign #Leave campaign set out to wilfully mislead the electorate!
Fool me once, shame on Leave! Fool me twice, shame on me!

@RosiesHelper @Go4gold100 @MeanderingPaul @Nick_Nomi @kjlherbalife @Tanners1983 @FarrellySharon @BorisJohnson OK, so Cummings, the Leave campaign director, thinks people were 'fooled' as he says in his Dec 2016 blog that Leave wouldn't have won without the lies!
Also, many many people have come forward saying they believed one lie or other, but most often the #NHS350M one!
Facts eh!

@RosiesHelper @Go4gold100 @MeanderingPaul @Nick_Nomi @kjlherbalife @Tanners1983 @FarrellySharon @BorisJohnson What “two”?
All the Leave campaign was on things that were never going to be delivered!
So people were fooled!

@RosiesHelper @Go4gold100 @MeanderingPaul @Nick_Nomi @kjlherbalife @Tanners1983 @FarrellySharon @BorisJohnson Might it be because "immigrants" aren't the problem? They really aren't!
EVERYTHING Leavers voted against is our Governments fault and NONE of it is the fault of the EU.
You were either fooled or you're part of the machine doing the fooling!

@BrexitResist @ScottishJenbel @BorisJohnson Friend of mine, ex-senior exec at @DeutscheBank, doesn't think so. Perhaps focus your energies on #EU wellbeing? 

Have a nice day.

#Brexit #r4today

@BorisJohnson You are no Winston Boris. 

Your false cause &amp; subsequent disruptions have resulted in massive damage to the country already. 

It’s time to reflect back and stop before you cause total ruin and trigger the break up of the UK.

